import React,{Component} from 'react';
import './App.css';
import languageList from './languageList';
import VoteField from './VoteField';


class Voting extends Component{
	constructor(props){
		super(props);
	}

	render(){
		return(
			<div className="languages">
				<h1>Vote for a language</h1>
				{languageList.map(language => <VoteField languageName={language.languageName} />)}
				<VoteField languageName="Java"/>
				<VoteField languageName="JavaScript"/>
				<VoteField languageName="Python"/>
				<VoteField languageName="Typescript"/>
			</div>
		);
	}
}
export default Voting;
